import { useEffect, useState } from 'react'
import data from '../data.json'




const JobCard = () => {
  const [jobs, setJobs] = useState([])

  useEffect(() => {
    setJobs(data)
    console.log(data)
  }, [])



  return (
    <div className='job-cards'>
      {jobs.map((job) => {
        console.log(job.logo)
        return (
          <div className='job' key={job.id}>
            <img src='./images/loop-studios.svg' alt="" />
            <div>
              <div className='job-top-description'>
                <p>{job.company}</p>
                <p>{job.new ? 'NEW' : null}</p>
                <p>{job.featured ? 'FEATURED' : null}</p>
              </div>
              <h1>{job.position}</h1>
              <div className='job-bottom-description'>
                <p>{job.postedAt}</p>
                <p>{job.contract}</p>
                <p>{job.location}</p>
              </div>
            </div>
            <div className='tags'>
              {job.languages.map((tag) => {
                return (
                  <div className='tag' key={tag.id}>
                    <p>{tag}</p>
                  </div>
                )
              })}
            </div>

          </div>
        )
      })}
    </div>
  )
}

export default JobCard
